//@ts-ignore
import Inspiration from "../assets/svg/sidenav/inspiration.svg";
//@ts-ignore
import Templates from "../assets/svg/sidenav/templates.svg";
//@ts-ignore
import Collections from "../assets/svg/sidenav/collection.svg";
//@ts-ignore
import Brands from "../assets/svg/sidenav/brands.svg";
//@ts-ignore
import Chevron from "../assets/svg/sidenav/chevron.svg";
//@ts-ignore
import Add from "../assets/svg/sidenav/add.svg";
//@ts-ignore
import Dots from "../assets/svg/sidenav/dots.svg";
//@ts-ignore
import Lock from "../assets/images/lock-tag.png";
import { useState } from "react";
interface NavItem {
  navName: string;
  navImageUrl: string;
}

const SideBar: React.FC = () => {
  const [opened, setOpened] = useState<boolean>(true);

  const sideNavNames: NavItem[] = [
    { navName: "Inspiration", navImageUrl: Inspiration },
    { navName: "Templates", navImageUrl: Templates },
    { navName: "Collections", navImageUrl: Collections },
    { navName: "Brands", navImageUrl: Brands },
  ];

  const featuredNav: NavItem[] = [
    { navName: "Hidden gems", navImageUrl: Lock },
    { navName: "Evergreen ads", navImageUrl: Lock },
    { navName: "Testing lab", navImageUrl: Lock },
  ];

  return (
    <div
      className={
        `flex flex-col bg-gray-50 max-h-[calc(100vh-80px)] min-h-[calc(100vh-80px)] h-full p-4 overflow-auto transition-all duration-300 ${
        opened ? "max-w-[250px]" : "max-w-[50px]"
      } border-r border-gray-300`}
    >
      {sideNavNames.map((nav, index) => (
        <div
          key={index}
          className="flex justify-between items-center gap-2 w-full"
        >
          {opened && (
            <div className="flex items-center w-full gap-3 p-3 hover:border hover:border-purple-500 cursor-pointer rounded-md">
              <img src={nav.navImageUrl} alt={nav.navName} className="w-4 h-4" />
              <span className="font-semibold">{nav.navName}</span>
            </div>
          )}
          {index === 0 && (
            <img
              src={Chevron}
              alt="Toggle"
              className={`w-3 h-5 transform transition-transform duration-300 ${
                opened ? "rotate-0" : "rotate-180"
              } cursor-pointer`}
              onClick={() => setOpened(!opened)}
            />
          )}
        </div>
      ))}

      {opened && (
        <div className="flex flex-col gap-5 mt-4">
          <hr className="border-gray-300" />
          <span className="text-gray-500 text-xs font-semibold">FEATURED</span>
          <div className="flex flex-col gap-0 mx-5">
            {featuredNav.map((nav, index) => (
              <div key={index} className="flex justify-between items-center p-2">
                <span className="font-semibold">{nav.navName}</span>
                <img src={nav.navImageUrl} alt={nav.navName} className="w-8 h-4" />
              </div>
            ))}
          </div>
          <hr className="border-gray-300" />
          <div className="flex justify-between items-center">
            <span className="text-gray-500 text-xs font-semibold">SAVED</span>
            <img src={Add} alt="Add" className="w-3 h-3" />
          </div>
          <div className="flex gap-5">
            <div
              className="h-36 w-[1px]"
              style={{
                background:
                  "linear-gradient(90deg, #A259FF 0%, #613599 100%)",
              }}
            />
            <div className="flex flex-col gap-4 w-[80%] mx-5">
              {Array(5)
                .fill("Board name")
                .map((name, index) => (
                  <div
                    key={index}
                    className="flex justify-between items-center"
                  >
                    <span className="font-medium">{name}</span>
                    <img src={Dots} alt="Options" />
                  </div>
                ))}
            </div>
          </div>
          <span className="font-medium">View all boards</span>
          <hr className="border-gray-300" />
          <div className="flex flex-col">
            <span className="font-medium">Settings</span>
            <span className="font-medium">Help & Feedback</span>
            <span className="font-medium">Join the CreativeOS Slack</span>
          </div>
          <hr className="border-gray-300" />
          <div className="flex items-center gap-3">
            <div className="w-10 h-10 bg-purple-500 rounded-full" />
            <span className="font-medium">My Account</span>
          </div>
        </div>
      )}
    </div>
  );
};

export default SideBar;
